    }

    private ResponseEntity<Map<String, Object>> postForAccessToken(HttpEntity<?> entity) {
        return getRestTemplate().exchange("https://accounts.google.com/o/oauth2/token", HttpMethod.POST, entity, Map.class);
    }
}

